pragma solidity >=0.4.22 <0.6.0;
contract Leaderboard {
    mapping (address => uint256) private _highscores;

    function setHighscore(address to, uint256 value) public returns (bool) {
        _highscores[to] = _highscores[to] + value;
        return true;
    }

    function getHighscore(address a) public view returns (uint256) {
        return _highscores[a];
    }
}
